import React ,{useContext,useEffect} from "react";
import "../Home.css"
import { useLocation,useNavigate} from "react-router-dom";
import NoteContext from "../context/noteContext";


const Home = () => {


  var No_Notes;
  const { initialNotes } = useContext(NoteContext);
  const navigate=useNavigate();

  const location=useLocation();
  const user=location.state?.user;
  const auth_Token=location.state?.auth_Token;

  //to store user name,email and id,
  localStorage.setItem('name',user.name);
  localStorage.setItem('email',user.email);
  localStorage.setItem('id',user.id);

  console.log("Home user"+localStorage.getItem('name'));
  console.log("Home user"+localStorage.getItem('email'));
  console.log("Home user"+localStorage.getItem('id'));
  console.log("Home user"+auth_Token);
  

  
  
  useEffect(() => {
    const fetchNotes = async () => {
          if (localStorage.getItem('auth_token')) {
            await initialNotes();
          } else {
            navigate('/login');
          }


          
          if(localStorage.getItem('No_Notes')){
           No_Notes=localStorage.getItem('No_Notes');
        }
        else{
          navigate('/login');
        
        }
        };
        fetchNotes();
      }, []);

  
  return (
    <>
      <div className="container mt-4 mb-4 p-3 d-flex justify-content-center">
        <div className="profilecard card p-4">
          <div className=" image d-flex flex-column justify-content-center align-items-center">
            <button className="btn btn2 btn-secondary">
              {" "}
              <img
                src="https://i.imgur.com/wvxPV9S.png"
                height="100"
                width="100"
              />
            </button>
            <span className="name mt-3">{user.name}</span>{" "}
            <span className="idd">{user.email}</span>
            <div className="d-flex flex-row justify-content-center align-items-center gap-2">
            <span className="idd">{user.id}</span>
            <span  style={{ cursor: "pointer" }} onClick={() => { navigator.clipboard.writeText(user.id);
                                        alert("User id copied to clipboard!"); }}>
 
                <i className="fa fa-copy"></i>
              </span>{" "}
              </div>
            <div className="d-flex flex-row justify-content-center align-items-center gap-2">
              <span className="idd1"><strong>Token:</strong> {auth_Token}</span>
              <span  style={{ cursor: "pointer" }} onClick={() => { navigator.clipboard.writeText(auth_Token);
                                        alert("Auth token copied to clipboard!"); }}>
 
                <i className="fa fa-copy"></i>
              </span>{" "}
            </div>
            <div className="d-flex flex-row justify-content-center align-items-center mt-3">
              <span className="number">
                {No_Notes ? No_Notes :"0"} <span className="follow">Notes</span>
              </span>{" "}
            </div>
            <div className=" d-flex mt-2">
              {" "}
              <button className="btn1 btn-dark">View Notes</button>{" "}
            </div>
            <div className="text mt-3">
              {" "}
              <span>
                Eleanor Pena is a creator of minimalistic x bold graphics and
                digital artwork.
                <br />
                <br /> Artist/ Creative Director by Day #NFT minting@ with FND
                night.{" "}
              </span>
            </div>
            <div className="gap-3 mt-3 icons d-flex flex-row justify-content-center align-items-center">
              {" "}
              <span>
                <i className="fa fa-twitter"></i>
              </span>
              <span>
                <i className="fa fa-facebook-f"></i>
              </span>{" "}
              <span>
                <i className="fa fa-instagram"></i>
              </span>
              <span>
                <i className="fa fa-linkedin"></i>
              </span>{" "}
            </div>
            <div className=" px-2 rounded mt-4 date ">
              <span className="join">Joined May,2021</span>{" "}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
